import NavBar from './Navbar'
import Head from 'next/head'

const Layout = (props) => {
    return <div>
        <Head>
            <title>hey</title>
            <link rel="stylesheet" href="https://bootswatch.com/4/minty/bootstrap.min.css" />
        </Head>
        <NavBar />
        <div id="main-content-container">
            {props.children}
        </div>
        <style jsx>{`
            #main-content-container {
                margin: 50px;
            }
        `}</style>
    </div>
}

export default Layout
